import UIKit
import Foundation

class SecondScreenRouter: BaseRouter {
    
    // MARK: - Private properties
    private let storyboard = UIStoryboard(name: "SecondScreen", bundle: nil)
    
    // MARK: Module Setup
    init() {
        let moduleViewController = storyboard.instantiateViewController(ofType: SecondScreenViewController.self)
        super.init(viewController: moduleViewController)
        let interactor = SecondScreenInteractor()
        let presenter = SecondScreenPresenter(view: moduleViewController, interactor: interactor, router: self)
        moduleViewController.presenter = presenter
        interactor.presenter = presenter
    }
    
}

